import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First perform a search to get to a page with view toggle controls
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results to load and view toggle to appear
    await page.waitForSelector('.view-toggle', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Click the list view button
    await page.click('button[title="List View"]');

    // Wait for view to switch to list mode
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Verify the switch was successful
    const isListViewActive = await page.$eval('button[title="List View"]', 
      button => button.classList.contains('active'));
    const productContainerClass = await page.$eval('.products-list, .products-grid', 
      el => el.className);

    return {
      success: true,
      action: "Switched to list view mode successfully",
      extractedData: {
        listViewActive: isListViewActive,
        productContainerClass: productContainerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to list view mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
